import React from 'react';

function TodoListItem({ listItem, onRemoveTodo }) {
    return (
        <li>
            {listItem.title} <br></br>
            <button onClick={() => onRemoveTodo(listItem.id)}>Remove</button>
        </li>
    );
}

export { TodoListItem }
